// Library components

import { Grid, 
        InputAdornment,
        Typography,
        Fab
} from '@mui/material'
import { CTextField } from './products/Products' 
import React from 'react'

// Icons
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import AddIcon from '@mui/icons-material/Add';
import { useNavigate } from 'react-router-dom';



const Invoice = () => {
// Navigation
let NavS = useNavigate();



  return (
    <div>
      {/* Whole Container */}
        <Grid container spacing={2}>

{/* Search bar container */}
          <Grid item md={9} >

            {/* Para may padding */}
           <Grid 
           container 
           padding={5}
           direction="row"
           justifyContent="center"
           alignItems="flex-start">

             {/* Search bar */}
              <CTextField 
              variant='standard' 
              fullWidth 
              placeholder='Searchbar'

              InputProps={{
                endAdornment: (
                  <InputAdornment position="start">
    
                    <SearchOutlinedIcon fontSize='large' />
                 
                  </InputAdornment>
                ),
              }}
              />
           </Grid>
    
          </Grid>

          {/* Conatainer button */}
          <Grid item md={3}>

            {/* Container para may padding */}
            <Grid 
            container 
            padding={5}           
            direction="row"
            justifyContent="center"
            alignItems="flex-start">

              {/* Button add */}
              <Fab 
              color="primary" 
              variant='extended' 
              aria-label="add" 
              onClick={e=>NavS("/Mainpage/Products/AddItem")} 
              >
                <AddIcon />
                add item
              </Fab>

            </Grid>
            
          </Grid>

        </Grid>
    </div>
  )
}

export default Invoice
